          "comments": [
            {
              "file": "jenkins-init-scripts/package-listing.sh",
              "line": 4,
              "reviewer": ids["zxiiro"],
              "message": "2018\n\n... Unless this was copied from somewhere?",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "jenkins-init-scripts/package-listing.sh",
              "line": 4,
              "reviewer": ids["agrimberg"],
              "message": "Done",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "jenkins-init-scripts/package-listing.sh",
              "line": 13,
              "reviewer": ids["zxiiro"],
              "message": "I\u0027d consider this a breaking change as we need to ensure all bootscripts use the new init scripts change. The init scripts patch wasn\u0027t a breaking change because it didn\u0027t require people to install it. This patch would now force people upgrading global-jjb to have to install the new init scripts moving forward.\n\nI would put a note in the commit message to state that this is a breaking change.",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "jenkins-init-scripts/package-listing.sh",
              "line": 13,
              "reviewer": ids["agrimberg"],
              "message": "I\u0027ve made this more dynamic and should make it less of a breaking change.",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "shell/package-listing.sh",
              "line": 4,
              "reviewer": ids["zxiiro"],
              "message": "2018\n\n... Unless this was copied from somewhere?",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "shell/package-listing.sh",
              "line": 19,
              "reviewer": ids["zxiiro"],
              "message": "I like putting underscores in to make it easier to read the variables at a quick glance.\n\nOS_FAMILY for example.\n\nSame with START_PACKAGES, END_PACKAGES, and DIFF_PACKAGES below.",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "shell/package-listing.sh",
              "line": 19,
              "reviewer": ids["agrimberg"],
              "message": "Done",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "shell/package-listing.sh",
              "line": 26,
              "reviewer": ids["zxiiro"],
              "message": "If this is true then there WILL be a starting_packages file.\n\nIs that right?",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "shell/package-listing.sh",
              "line": 26,
              "reviewer": ids["agrimberg"],
              "message": "Correct. I\u0027ve fixed this.",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "shell/package-listing.sh",
              "line": 49,
              "reviewer": ids["zxiiro"],
              "message": "Unnecessary comment. We can easily see a diff is being created by looking at the code.",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "shell/package-listing.sh",
              "line": 49,
              "reviewer": ids["agrimberg"],
              "message": "Done",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "shell/package-listing.sh",
              "line": 65,
              "reviewer": ids["zxiiro"],
              "message": "do we want `cp -f` here in case a file already exists?",
              "patchSetTimestamp": 1528408528000
            },
            {
              "file": "shell/package-listing.sh",
              "line": 65,
              "reviewer": ids["agrimberg"],
              "message": "Done. Though there really shouldn\u0027t be a file there of that name.",
              "patchSetTimestamp": 1528408528000
            }
          ],
