      "owner": ids["bramwelt"],
      "url": "https://gerrit.linuxfoundation.org/infra/10689",
      "commitMessage": "Support the .yml YAML File Suffix for CI Jobs\n\nChange-Id: I410ba824c0d1d1fbeb763fe994a9a4a667b157e3\nSigned-off-by: Trevor Bramwell \u003ctbramwell@linuxfoundation.org\u003e\n",
      "createdOnDate": 1526513945000,
      "lastUpdatedDate": 1526578708000,
      "isOpen": false,
      "status": "MERGED",
      "reviewers": [
        ids["agrimberg"],
        ids["bramwelt"],
        ids["lf-jenkins"],
        ids["jluhrsen"]
      ],
      "comments": [
        {
          "timestamp": 1526513945000,
          "reviewer": ids["bramwelt"],
          "message": "Uploaded patch set 1."
        },
        {
          "timestamp": 1526514015000,
          "reviewer": ids["lf-jenkins"],
          "message": "Patch Set 1:\n\nBuild Started https://jenkins.opendaylight.org/releng/job/lf-infra-global-jjb-tox-verify-any/441/"
        },
        {
          "timestamp": 1526514212000,
          "reviewer": ids["lf-jenkins"],
          "message": "Patch Set 1: Verified+1\n\nBuild Successful \n\nhttps://jenkins.opendaylight.org/releng/job/lf-infra-global-jjb-tox-verify-any/441/ : SUCCESS\n\nLogs: https://logs.opendaylight.org/releng/vex-yul-odl-jenkins-1/lf-infra-global-jjb-tox-verify-any/441"
        },
        {
          "timestamp": 1526516590000,
          "reviewer": ids["jluhrsen"],
          "message": "Patch Set 1: Code-Review+2"
        },
        {
          "timestamp": 1526516592000,
          "reviewer": ids["jluhrsen"],
          "message": "Change has been successfully merged by Jamo Luhrsen"
        },
        {
          "timestamp": 1526564414000,
          "reviewer": ids["agrimberg"],
          "message": "Patch Set 1:\n\nWas there a reason for adding in this suffix handler? We had pretty much left it out to force everyone to use the exact same yaml suffix."
        },
        {
          "timestamp": 1526576587000,
          "reviewer": ids["bramwelt"],
          "message": "Patch Set 1:\n\n\u003e Was there a reason for adding in this suffix handler? We had pretty\n \u003e much left it out to force everyone to use the exact same yaml\n \u003e suffix.\n\nForce everyone to use the suffix? Seems odd not to support something that\u0027s officially allowed and common practice."
        },
        {
          "timestamp": 1526577246000,
          "reviewer": ids["agrimberg"],
          "message": "Patch Set 1:\n\n\u003e \u003e Was there a reason for adding in this suffix handler? We had\n \u003e pretty\n \u003e \u003e much left it out to force everyone to use the exact same yaml\n \u003e \u003e suffix.\n \u003e \n \u003e Force everyone to use the suffix? Seems odd not to support\n \u003e something that\u0027s officially allowed and common practice.\n\nPartly because it\u0027s the recommended extension for the files:\n\nhttp://yaml.org/faq.html\n\nI don\u0027t want to deal with our files ended up all named differently, I like the idea of forcing folks to use the recommended extension.\n\nAdditionally, the upstream JJB project only allows in .yaml files (look over their repo) I would prefer to not deviate from that."
        },
        {
          "timestamp": 1526578708000,
          "reviewer": ids["bramwelt"],
          "message": "Patch Set 1:\n\n\u003e \u003e \u003e Was there a reason for adding in this suffix handler? We had\n \u003e \u003e pretty\n \u003e \u003e \u003e much left it out to force everyone to use the exact same yaml\n \u003e \u003e \u003e suffix.\n \u003e \u003e\n \u003e \u003e Force everyone to use the suffix? Seems odd not to support\n \u003e \u003e something that\u0027s officially allowed and common practice.\n \u003e \n \u003e Partly because it\u0027s the recommended extension for the files:\n \u003e \n \u003e http://yaml.org/faq.html\n \u003e \n \u003e I don\u0027t want to deal with our files ended up all named differently,\n \u003e I like the idea of forcing folks to use the recommended extension.\n \u003e \n \u003e Additionally, the upstream JJB project only allows in .yaml files\n \u003e (look over their repo) I would prefer to not deviate from that.\n\nI would rather not continue the debate \n\n\u003e https://stackoverflow.com/a/38754994\n\nthat has gone on for years \n\n\u003e http://markdblackwell.blogspot.com/2013/07/use-file-extension-yml-for-yaml.html\n\nover whether .yaml or .yml is the preferred suffix.\n\nI\u0027m perfectly happy and fine with files within global-jjb ending in .yaml and us enforcing that. What I\u0027m not okay with is adding more barriers for communities to use helpful tools, especially since there is quite a lot of work needed to use global-jjb in the first place, and it is such a trivial amount of work on our part."
        }
      ],
