      "id": "I8d90fb81aa8e3b685b8cc6c962108384c4b762b7",
      "commitNumber": 10258,
      "subject": "Update JJB version to 2.0.6",
      "owner": ids["askb"],
      "url": "https://gerrit.linuxfoundation.org/infra/10258",
      "commitMessage": "Update JJB version to 2.0.6\n\nPull in all changes for managing views with JJB 2.0.6.\n\nhttps://jira.opendaylight.org/browse/RELENG-76\n\nChange-Id: I8d90fb81aa8e3b685b8cc6c962108384c4b762b7\nSigned-off-by: Anil Belur \u003cabelur@linuxfoundation.org\u003e\n",
      "createdOnDate": 1524784852000,
      "lastUpdatedDate": 1525819796000,
      "isOpen": false,
      "status": "ABANDONED",
      "reviewers": [
        ids["zxiiro"],
        ids["lf-jenkins"],
        ids["agrimberg"],
        ids["askb"]
      ],
      "comments": [
        {
          "timestamp": 1524784852000,
          "reviewer": ids["askb"],
          "message": "Uploaded patch set 1."
        },
        {
          "timestamp": 1524784910000,
          "reviewer": ids["lf-jenkins"],
          "message": "Patch Set 1:\n\nBuild Started https://jenkins.opendaylight.org/releng/job/lf-infra-global-jjb-tox-verify-any/396/"
        },
        {
          "timestamp": 1524785075000,
          "reviewer": ids["lf-jenkins"],
          "message": "Patch Set 1: Verified+1\n\nBuild Successful \n\nhttps://jenkins.opendaylight.org/releng/job/lf-infra-global-jjb-tox-verify-any/396/ : SUCCESS\n\nLogs: https://logs.opendaylight.org/releng/vex-yul-odl-jenkins-1/lf-infra-global-jjb-tox-verify-any/396"
        },
        {
          "timestamp": 1524844393000,
          "reviewer": ids["zxiiro"],
          "message": "Patch Set 1:\n\nWhy do we keep bumping this? Is there a template in global-jjb that requires 2.0.6? I don\u0027t think global-jjb itself declares any 2.0.6 code?\n\n(projects can use newer versions of JJB if they want)"
        },
        {
          "timestamp": 1524854694000,
          "reviewer": ids["zxiiro"],
          "message": "Patch Set 1: Code-Review+1"
        },
        {
          "timestamp": 1524854756000,
          "reviewer": ids["zxiiro"],
          "message": "Patch Set 1: Code-Review-1\n\n(1 comment)\n\nJust noticed the Jira link points to something entirely unrelated to the commit here."
        },
        {
          "timestamp": 1524956457000,
          "reviewer": ids["askb"],
          "message": "Uploaded patch set 2: Commit message was updated."
        },
        {
          "timestamp": 1524956515000,
          "reviewer": ids["lf-jenkins"],
          "message": "Patch Set 2:\n\nBuild Started https://jenkins.opendaylight.org/releng/job/lf-infra-global-jjb-tox-verify-any/399/"
        },
        {
          "timestamp": 1524956675000,
          "reviewer": ids["lf-jenkins"],
          "message": "Patch Set 2: Verified+1\n\nBuild Successful \n\nhttps://jenkins.opendaylight.org/releng/job/lf-infra-global-jjb-tox-verify-any/399/ : SUCCESS\n\nLogs: https://logs.opendaylight.org/releng/vex-yul-odl-jenkins-1/lf-infra-global-jjb-tox-verify-any/399"
        },
        {
          "timestamp": 1525013386000,
          "reviewer": ids["zxiiro"],
          "message": "Patch Set 2: Code-Review+1\n\nI\u0027m not against this patch but I still fail to understand why OpenDaylight\u0027s wanting to use Views has anything to do with global-jjb requiring 2.0.6 version of JJB. They can still install it regardless of what global-jjb itself sets as the default version.\n\nThere are no job templates in global-jjb that require 2.0.6 code today in the repo. My personal feeling is that global-jjb should define the minimal supported version of JJB so that all users of global-jjb are not forced to upgrade when they update global-jjb. This gives them the freedom to move to more recent versions of global-jjb at their leisure."
        },
        {
          "timestamp": 1525024664000,
          "reviewer": ids["agrimberg"],
          "message": "Patch Set 2: Code-Review-1\n\n\u003e I\u0027m not against this patch but I still fail to understand why\n \u003e OpenDaylight\u0027s wanting to use Views has anything to do with\n \u003e global-jjb requiring 2.0.6 version of JJB. They can still install\n \u003e it regardless of what global-jjb itself sets as the default\n \u003e version.\n \u003e \n \u003e There are no job templates in global-jjb that require 2.0.6 code\n \u003e today in the repo. My personal feeling is that global-jjb should\n \u003e define the minimal supported version of JJB so that all users of\n \u003e global-jjb are not forced to upgrade when they update global-jjb.\n \u003e This gives them the freedom to move to more recent versions of\n \u003e global-jjb at their leisure.\n\nIf the only reason for moving the global-jjb min version of jjb to 2.0.6 is because of a downstream project\u0027s desire to use views, when they have the ability to override the jjb that gets installed, then I don\u0027t believe that forcing everyone to upgrade is the correct approach."
        },
        {
          "timestamp": 1525047226000,
          "reviewer": ids["askb"],
          "message": "Patch Set 2:\n\nThanh, Andy - the Jenkins view implementation managed through code is fully available with \u003d\u003e2.0.6. I think having a minimum version sounds good for global-jjb.\n\nIt might be acceptable to continue using a older version (2.0.3 or 2.0.5) of JJB for global-jjb, but IMHO upgrading to newer version comes with new plugins being enabled + bug fixes etc + improvements. Adopting the newer version early helps us get know things which may also broken in our templates early and fix/report them with the projects/community."
        },
        {
          "timestamp": 1525103571000,
          "reviewer": ids["agrimberg"],
          "message": "Patch Set 2:\n\n\u003e Thanh, Andy - the Jenkins view implementation managed through code\n \u003e is fully available with \u003d\u003e2.0.6. I think having a minimum version\n \u003e sounds good for global-jjb.\n \u003e \n \u003e It might be acceptable to continue using a older version (2.0.3 or\n \u003e 2.0.5) of JJB for global-jjb, but IMHO upgrading to newer version\n \u003e comes with new plugins being enabled + bug fixes etc +\n \u003e improvements. Adopting the newer version early helps us get know\n \u003e things which may also broken in our templates early and fix/report\n \u003e them with the projects/community.\n\n@Anil the issue that I see is that we\u0027re forcing projects to update to a newer version of JJB when global-jjb _itself_ does not require this. Instead, I would prefer a note be added to the release notes about the need to update to JJB 2.0.6 if view management is needed."
        },
        {
          "timestamp": 1525819796000,
          "reviewer": ids["askb"],
          "message": "Abandoned\n\nNeed to keep min version of JJB in global-jjb."
        }
      ],
