              "file": "jjb/lf-python-jobs.yaml",
              "line": 176,
              "reviewer": ids["jwagantall"],
              "message": "Agree on safety.. i can use a settings file. But how can i call the individual variables in a command like this?\n\njava -jar ./nexus-iq-cli-\u003cversion\u003e.jar -xc -i Test123 -s http://localhost:8070\n-a username:password sample-application.zip",
