              "line": 385,
              "reviewer": ids["zxiiro"],
              "message": "This should actually be plural right? because according to docs the user can provide a list of jobs and is not limited to just one.\n\nIn which case I think this should be a {obj:var} variable so that we can accomodate.\n\n {obj:jobs-to-trigger}",
