          "comments": [
            {
              "file": "jjb/lf-ci-jobs.yaml",
              "line": 75,
              "reviewer": ids["zxiiro"],
              "message": "Let\u0027s not use anchors to fix this since we\u0027re updating this. Let\u0027s use {obj:var} instead this way we can also override if necessary. See:\n\nhttps://github.com/lfit/releng-global-jjb/blob/master/jjb/lf-maven-jobs.yaml#L820-L822",
              "patchSetTimestamp": 1507928038000
            },
            {
              "file": "jjb/lf-ci-jobs.yaml",
              "line": 75,
              "reviewer": ids["agrimberg"],
              "message": "I used an anchor here because the GitHub version of this will eventually need this (or something similar) as well when it finally supports ANT paths via JJB.\n\nGiven we have two different patterns and only one common anchor set I don\u0027t see how we can cleanly add in an object pass through like your suggesting.",
              "patchSetTimestamp": 1507928038000
            },
            {
              "file": "jjb/lf-ci-jobs.yaml",
              "line": 75,
              "reviewer": ids["zxiiro"],
              "message": "This is a Gerrit specific setting. So the current GitHub version of the job does not use filepaths at all. It just builds every patch at the moment.",
              "patchSetTimestamp": 1507928038000
            },
            {
              "file": "jjb/lf-ci-jobs.yaml",
              "line": 75,
              "reviewer": ids["agrimberg"],
              "message": "I\u0027m aware, but the plugin does support file paths per discussion with Jeremy. I thought Jeremy was submitting an update patch to JJB to get it in?",
              "patchSetTimestamp": 1507928038000
            },
            {
              "file": "jjb/lf-ci-jobs.yaml",
              "line": 75,
              "reviewer": ids["zxiiro"],
              "message": "Yes, and when that gets in we will have to handle that separately via a separate variable.",
              "patchSetTimestamp": 1507928038000
            },
            {
              "file": "jjb/lf-ci-jobs.yaml",
              "line": 88,
              "reviewer": ids["zxiiro"],
              "message": "I guess we should remove the old one if we\u0027re renaming it.",
              "patchSetTimestamp": 1507928038000
            },
            {
              "file": "jjb/lf-ci-jobs.yaml",
              "line": 88,
              "reviewer": ids["agrimberg"],
              "message": "We aren\u0027t renaming it, this anchor is still in use and it does the correct thing for merge jobs. It\u0027s explicitly for verify jobs that it needs to be manhandled.",
              "patchSetTimestamp": 1507928038000
            }
          ],
